import React from "react";
import './note.css'
import {BsFillTrashFill} from 'react-icons/bs'
import {AiFillEdit} from 'react-icons/ai'

function Note({id,title,content,onChecked}) {
  return (
    <div className="note">
      <h1>{title}</h1>
      <p>{content}</p>
      <button>
        <AiFillEdit/>
      </button>
      <button
        onClick={() => {
          onChecked(id);
        }}
      >
       <BsFillTrashFill />
      </button>
    </div>
  );
}

export default Note;
